export default function RestaurantComponent() {
    return (
        <div className="post">
            <div className="image">
                 <img src=""></img>
            </div>     
            <div className="texts">
                <h2>Название</h2>
                <p className="summary">Поиск и разведка нефтяных и газовых месторождений, комплексная оценка нефтегазоносных территорий и локальных объектов, подсчет запасов</p>
            </div>
    </div>
    )
}
